// Chargement de la CMP Appnexus
(function(window) {
    let language = document.querySelector("html").getAttribute("lang");
    let brand = document.querySelector("html").getAttribute("brand");

    window.__cmp = (function() {
        var listen = window.attachEvent || window.addEventListener;
        listen('message', function(event) {
            window.__cmp.receiveMessage(event);
        });

        var commandQueue = [];
        var cmp = function(command, parameter, callback) {
            commandQueue.push({
                command: command,
                parameter: parameter,
                callback: callback
            });
        };
        cmp.commandQueue = commandQueue;
        cmp.receiveMessage = function(event) {
            var data = event && event.data && event.data.__cmpCall;
            if (data) {
                commandQueue.push({
                    callId: data.callId,
                    command: data.command,
                    parameter: data.parameter,
                    event: event
                });
            }
        };
        cmp.config = {
            customPurposeListLocation: '/bundles/mblinepaasset/js/libraries/cmp/docs/purposes.json',
            globalConsentLocation: '/bundles/mblinepaasset/js/libraries/cmp/docs/portal.html',
            gdprApplies: true,
            forceLocale: language,
            theme: {
                primaryColor: (brand == 'ag') ? "#B2212B" : "#EE7D11",
                primaryTextColor: '#fff',
                secondaryColor: '#45586A',
                secondaryTextColor: '#fff',
                textLinkColor: '#45586A',
            }
        };
        return cmp;
    }());

    var t = document.createElement('script');
    t.async = false;
    t.src = 'res/js/cmp.bundle.js?6.1.8';
    var tag = document.getElementsByTagName('head')[0];
    tag.appendChild(t);

})(window);

// Récupère les cookies userId et activityDomainId pour les envoyer chez Xiti :
// déclaré ici car app.js est chargé après le layout et on en a besoin dans le layout
    function getCookie(c_name)
    {
        var cookies = document.cookie.split(";");
        for (i=0;i<cookies.length;i++)
        {
            var x=cookies[i].substr(0,cookies[i].indexOf("="));
            var y=cookies[i].substr(cookies[i].indexOf("=")+1);
            x=x.replace(/^\s+|\s+$/g,"");
            if (x==c_name)
            {
                return unescape(y);
            }
        }
    }
    var cookiesLoggedUser = getCookie("logged_user");
    if (cookiesLoggedUser) {
        cookiesLoggedUser = decodeURIComponent(cookiesLoggedUser);
        cookiesLoggedUser = JSON.parse(cookiesLoggedUser);
        var userId = cookiesLoggedUser['userId'];
        var activityDomainId = cookiesLoggedUser['activityDomainId']
    } else {
        var userId = "";
        var activityDomainId = "";
    }
    window.userId = userId;
    window.activityDomainId = activityDomainId;
// Fin récup des cookies

